// 防抖
export function _debounce(fn, delay) {
  let timer
  return function () {
    const th = this
    const args = arguments
    if (timer) {
      clearTimeout(timer)
    }
    timer = setTimeout(function () {
      timer = null
      fn.apply(th, args)
    }, delay || 200)
  }
}

// 获取url参数
export function getQueryVariable(variable, link) {
  const url = link || window.location.href
  const query = url.includes('?') && url.split('?')[1]
  if (query) {
    const vars = query.split('&')
    for (let i = 0; i < vars.length; i++) {
      const pair = vars[i].split('=')
      if (pair[0] === variable) {
        return pair[1]
      }
    }
  }
  return false
}

export function showMessage(msg, color = 'green', time = 2000) {
  const scuessImg =
    'data:image/png;base64,'
  const errorImg =
    'data:image/png;base64,'
  const className = color === 'red' ? 'v-message v-message-error' : 'v-message'
  const template = '<div id="tip-message"  class="' + className + '">' + '<img src="' + (color === 'red' ? errorImg : scuessImg) + '">' + msg + '</div>'
  const element = document.createRange().createContextualFragment(template)
  document.body.appendChild(element)
  setTimeout(() => {
    document.body.removeChild(document.getElementById('tip-message'))
  }, time)
}
